import React from "react";
import "./headsect.css";

const headsect = () => {
  return (
    <React.StrictMode>
      <div>
        <div class="container demo">
          <div class="content">
            <div id="large-header" class="large-header">
              <canvas id="demo-canvas"></canvas>
              <h1 class="main-title">
                <span class="thin">Explore</span> Space
              </h1>
            </div>
          </div>
        </div>
      </div>
    </React.StrictMode>
  );
};

export default headsect;
